import "./App.css";
import Button from "@mui/material/Button";
import { SearchForm } from "./Components";

function App() {
    return (
        <div className="App">
            <header className="App-header">
                <SearchForm />
                <p>std-notification transaction 조회</p>
                <Button variant="contained">Contained</Button>
            </header>
        </div>
    );
}

export default App;
